INSERT INTO COM_FINVI_OASIS_ACCOUNT_{PP_TenantName}.CUSTOMERCONTACTADDRESS ( 	UUID, 	CREATEDATE, 	LASTUPDATEDATE, 	CREATORID, 	LASTUPDATERID,	 	ADDRESS1, 	PARSEDADDRESS1,	 	ADDRESS2, 	CITY, 	PARSEDCITY,	 	STATEID, 	COUNTRYID, 	POSTALCODE, 	COUNTRY,	 	CUSTOMERID, 	HISTORICAL, 	TYPEID, 	SOURCE, 	EXPRESSCONSENT, 	ISDEFAULT, 	SOURCEREFERENCEID ) SELECT  	SYS_GUID() AS UUID, 	SYSDATE AS CREATEDATE, 	SYSDATE AS LASTUPDATEDATE,	     (SELECT ID FROM COM_FINVI_OASIS_ACCOUNT_{PP_TenantName}.user_ WHERE USERNAME = 'etlmigrationuser@finvi.com') AS CREATORID,     (SELECT ID FROM COM_FINVI_OASIS_ACCOUNT_{PP_TenantName}.user_ WHERE USERNAME = 'etlmigrationuser@finvi.com') AS LASTUPDATERID,	 	A.ARENADR AS ADDRESS1, 	lower(REGEXP_REPLACE(A.ARENADR ,'[^a-zA-Z0-9]')) AS PARSEDADDRESS1, 	A.ARENUNT AS ADDRESS2, 	A.ARENCTY AS CITY, 	lower(REGEXP_REPLACE(A.ARENCTY ,'[^a-zA-Z0-9]')) AS PARSEDCITY,	 	S.ID AS STATEID, 	S.COUNTRY_ID AS COUNTRYID, 	REPLACE(A.ARENZIP, '-', '') AS POSTALCODE, 	A.ARENCNTRY AS COUNTRY, 	B.CUSTOMERID AS CUSTOMERID, 	A.BAD_ADDRESS AS HISTORICAL, 	1 AS TYPEID, 	'CLIENT' AS SOURCE, 	'YES' AS EXPRESSCONSENT,  	CASE WHEN A.BAD_ADDRESS = 'Y' OR (A.ARENADR IS NULL OR A.ARENCTY IS NULL OR REPLACE(A.ARENZIP, '-', '') IS NULL ) THEN 0 ELSE 1 END AS ISDEFAULT,	 	(SELECT ID FROM COM_FINVI_OASIS_STATIC_DATA_{PP_TenantName}.DEMOGRAPHIC_SOURCE WHERE SOURCE = 'Client') AS SOURCEREFERENCEID FROM  	ETL_OASIS_DATA_MIG_{PP_TenantName}.ETL_STG_PARTY_INFO A 	INNER JOIN COM_FINVI_OASIS_ACCOUNT_{PP_TenantName}.CUSTOMER B ON A.CONSUMERID=B.MIGRATION_SOURCE_ID 	LEFT OUTER JOIN COM_FINVI_OASIS_STATIC_DATA_{PP_TenantName}.STATE S ON S.CODE=A.ARENST WHERE  	( 		A.ARENADR IS NOT NULL OR  		A.ARENUNT IS NOT NULL OR  		A.ARENCTY IS NOT NULL OR  		A.ARENST IS NOT NULL OR  		A.ARENZIP IS NOT NULL OR  		A.ARENCNTRY IS NOT NULL 	)